import React, { Component } from 'react'
import {Link} from "react-router-dom"


export class nav extends Component {
    render() {
        return (
            <div className="nav">
                <Link to="/login"> Sing in </Link>
                <Link to="/signup">Sign up</Link>
            </div>
        )
    }
}

export default nav
